import usePageNavigation from "./usePageNavigation";
const CreateEventHeader = ({ onBack, onUserInfo }) => (
    <>
        <div>+--------------------------------------------+</div>
        <div>|  <a className="clickable" >&lt; Back</a>      Create Event      <span className="clickable" onClick={onUserInfo}>[USER]</span>  |</div>
        <div>+--------------------------------------------+</div>
        <div>|                                            |</div>
    </>
);

export default CreateEventHeader
